Create Database Streamflix;
Use Streamflix;
CREATE TABLE Movies (
    MovieID	INT,
    Title	VARCHAR(512),
    Genres	VARCHAR(512),
    Year	INT,
    Language	VARCHAR(512),
    Country	VARCHAR(512),
	TotalViews VARCHAR(512)
);

    
    show tables;
    
    select * from movies;
    
    CREATE TABLE Users (
    UserID	VARCHAR(512),
    Age	INT,
    Gender	VARCHAR(512),
    Country	VARCHAR(512),
    SubscriptionStatus	VARCHAR(512),
    TotalWatchTime	INT,
    Device	VARCHAR(512)
);

   
   select * from users;
   
   CREATE TABLE Ratings_Dataset (
    RatingID	INT,
    UserID	VARCHAR(512),
    MovieID	INT,
    Rating	DOUBLE,
    Timestamp	VARCHAR(512)
);

    
    select * from ratings_dataset;
    
    show tables;